// SPDX-License-Identifier: MIT
pragma solidity ^0.8.0;

contract PodAccessLogger {
    // Evento emesso quando il FS accede a un POD
    event PodAccessRecorded(address indexed server, string podUrl, uint256 timestamp);

    // Struttura per memorizzare gli accessi
    struct Access {
        address server; // Chi ha effettuato l'accesso
        uint256 timestamp; // Quando  stato effettuato
    }

    // Mappatura per memorizzare gli accessi per ogni POD
    mapping(string => Access[]) public podAccesses;

    // Mappatura per associare un utente ai propri POD
    mapping(address => string[]) public userPods;

    // Metodo per registrare un accesso al POD
    function recordAccess(string memory podUrl) public {
        // Verifica che il POD sia associato a un utente
        require(podHasOwner(podUrl), "POD non associato a nessun utente.");

        // Aggiungi l'accesso alla lista degli accessi per il POD
        podAccesses[podUrl].push(Access({
            server: msg.sender,
            timestamp: block.timestamp
        }));

        // Emetti l'evento di accesso
        emit PodAccessRecorded(msg.sender, podUrl, block.timestamp);
    }

    // Metodo per associare un POD a un utente (da fare solo la prima volta)
    function associatePod(address user, string memory podUrl) public {
        require(!podHasOwner(podUrl), "POD precedentemente associato ad un utente.");
        userPods[user].push(podUrl);
    }

    // Metodo per verificare se un POD ha un proprietario
    function podHasOwner(string memory podUrl) public view returns (bool) {
        string[] storage pods = userPods[msg.sender];
        for (uint i = 0; i < pods.length; i++) {
            if (keccak256(abi.encodePacked(pods[i])) == keccak256(abi.encodePacked(podUrl))) {
                return true;
            }
        }
        return false;
    }

    function getAccesses() public view returns (Access[] memory) {
        string[] storage pods = userPods[msg.sender]; // Recupera i POD dell'utente
        uint256 totalAccesses = 0;

        // Calcola il numero totale di accessi
        for (uint i = 0; i < pods.length; i++) {
            totalAccesses += podAccesses[pods[i]].length;
        }

        // Crea un array di dimensioni pre-calcolate
        Access[] memory accesses = new Access[](totalAccesses);
        uint256 index = 0;

        // Popola l'array con i dati degli accessi
        for (uint i = 0; i < pods.length; i++) {
            Access[] storage podAccess = podAccesses[pods[i]];
            for (uint j = 0; j < podAccess.length; j++) {
                accesses[index] = podAccess[j];
                index++;
            }
        }

        return accesses;
    }

}
